        <input type="text" id="prod" name="prod" placeholder="Producto(Tornillo, Hamburguesas, Aspirinas, quizas almuerzo corrientes, costilla de res , etc)" autocomplete="off" maxlength="200" /> 
    </div>
    );
    }
     export default LocationProduct;
